import React, { useEffect, useRef } from 'react';
import { Bell, User, Check, X } from 'lucide-react';
import { Button } from '@/components/ui/button';
import { Avatar, AvatarFallback, AvatarImage } from '@/components/ui/avatar';
import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuTrigger,
} from '@/components/ui/dropdown-menu';
import { Badge } from '@/components/ui/badge';
import { useConnectionRequests } from '@/hooks/useConnectionRequests';
import { Card, CardContent } from '@/components/ui/card';

export const ConnectionNotificationDropdown = () => {
  const { 
    notifications, 
    loading, 
    acceptConnectionRequest, 
    declineConnectionRequest 
  } = useConnectionRequests();
  
  const audioRef = useRef<HTMLAudioElement | null>(null);
  const previousNotificationCount = useRef(0);

  // Filter for pending connection requests
  const pendingConnections = notifications.filter(
    notification => !notification.is_read && 
    notification.connection?.status === 'pending'
  );

  // Play notification sound when new connection requests arrive
  useEffect(() => {
    if (pendingConnections.length > previousNotificationCount.current && previousNotificationCount.current > 0) {
      // Create and play a simple notification sound
      if (!audioRef.current) {
        audioRef.current = new Audio();
        audioRef.current.src = 'data:audio/wav;base64,';
        audioRef.current.volume = 0.3;
      }
      
      try {
        audioRef.current?.play().catch(error => {
          console.log('Could not play notification sound:', error);
        });
      } catch (error) {
        console.log('Error playing notification sound:', error);
      }
    }
    
    previousNotificationCount.current = pendingConnections.length;
  }, [pendingConnections.length]);

  const handleAccept = async (connectionId: string, notificationId: string) => {
    await acceptConnectionRequest(connectionId, notificationId);
  };

  const handleDecline = async (connectionId: string, notificationId: string) => {
    await declineConnectionRequest(connectionId, notificationId);
  };

  if (pendingConnections.length === 0) {
    return null;
  }

  return (
    <DropdownMenu>
      <DropdownMenuTrigger asChild>
        <div className="relative">
          <Button variant="ghost" size="sm" className="relative">
            <Bell className="h-5 w-5" />
            {pendingConnections.length > 0 && (
              <Badge 
                className="absolute -top-1 -right-1 h-5 w-5 rounded-full bg-red-500 text-white text-xs flex items-center justify-center p-0 animate-pulse"
              >
                {pendingConnections.length}
              </Badge>
            )}
          </Button>
        </div>
      </DropdownMenuTrigger>
      
      <DropdownMenuContent 
        align="end" 
        className="w-80 max-h-96 overflow-y-auto"
        sideOffset={5}
      >
        <div className="p-3">
          <h3 className="font-semibold text-sm mb-3">Connection Requests</h3>
          <div className="space-y-3">
            {pendingConnections.map((notification) => (
              <Card key={notification.id} className="border-0 shadow-sm">
                <CardContent className="p-3">
                  <div className="flex items-start gap-3">
                    <Avatar className="h-10 w-10">
                      {notification.connection?.requester_profile?.photo_url ? (
                        <AvatarImage 
                          src={notification.connection.requester_profile.photo_url} 
                          alt={notification.connection.requester_profile.name} 
                        />
                      ) : (
                        <AvatarFallback>
                          <User className="h-5 w-5" />
                        </AvatarFallback>
                      )}
                    </Avatar>
                    
                    <div className="flex-1 min-w-0">
                      <div className="text-sm font-medium text-gray-900 mb-1">
                        {notification.connection?.requester_profile?.name || 'Unknown User'}
                      </div>
                      
                      {notification.connection?.requester_profile?.role && (
                        <div className="text-xs text-gray-500 mb-1">
                          {notification.connection.requester_profile.role}
                          {notification.connection.requester_profile.company && 
                            ` at ${notification.connection.requester_profile.company}`
                          }
                        </div>
                      )}
                      
                      <p className="text-xs text-gray-600 mb-3">
                        Wants to connect with you
                      </p>
                      
                      <div className="flex gap-2">
                        <Button
                          size="sm"
                          className="flex-1 h-7 text-xs"
                          onClick={() => handleAccept(
                            notification.connection!.id, 
                            notification.id
                          )}
                        >
                          <Check className="h-3 w-3 mr-1" />
                          Accept
                        </Button>
                        
                        <Button
                          size="sm"
                          variant="outline"
                          className="flex-1 h-7 text-xs"
                          onClick={() => handleDecline(
                            notification.connection!.id, 
                            notification.id
                          )}
                        >
                          <X className="h-3 w-3 mr-1" />
                          Decline
                        </Button>
                      </div>
                    </div>
                  </div>
                </CardContent>
              </Card>
            ))}
          </div>
        </div>
      </DropdownMenuContent>
    </DropdownMenu>
  );
};